import React from "react";
import "./Leaders.css";

export default function Leaders(){
	return(
		<div className="wrapper">
			<header>
				<h2>The Leaders</h2>
				<p>Check the winners and losers of the pandemic</p>
			</header>
		</div>
		);
}
